import React, { useState } from "react";
import "./index.css";
import StatusBar from "./StatusBar";

function App() {
  const [step, setStep] = useState(2)

  return (
    <div className="pt-4 px-16">
      <div className="h-[100px]">
        <StatusBar
          currentStep={step}
          setStep={setStep}
          stepsName={["Screening interview", "Tecknicall interview", "Fit interview", "Contract Negociation"]}
        />
      </div>
      <div className="flex flex-row gap-4 justify-end"> 
        <button className="p-2 px-4 underline rounded-xl">Return</button>
        <button className="p-2 px-4 bg-blue-400 rounded-xl text-white">Next</button>
      </div>
    </div>
  );
}

export default App;
